from .. import loader, utils  # pylint: disable=relative-beyond-top-level
import io
from PIL import Image, ImageDraw, ImageFont
import base64
import logging


logger = logging.getLogger(__name__)

def register(cb):
	cb(SpeedReadMod())


@loader.tds
class SpeedReadMod(loader.Module):
	"""каждое слово раз в 100мс"""
	strings = {
		"name": "SpeedRead"
	}

	async def client_ready(self, client, db):
		self.client = client
	
	
	@loader.sudo
	async def srcmd(self, message):
		""".sr <text or reply>"""
		text = utils.get_args_raw(message)
		
		if not text:
			reply = await message.get_reply_message()
			if not reply:
				await message.edit("нет текста")
				return
			text = reply.raw_text
		text = text.split()
		frames = []
		await message.edit("SpeedReadMod")
		for i in text:
			x = y = 512
			image = Image.new("RGB", (x, y), (255, 255, 255))
			draw = ImageDraw.Draw(image)
			fontsize = 60
			width, height = (512, 512)
			while (width, height) >= (512, 512):
				fontsize -= 3
				font_io = io.BytesIO(base64.b64decode(b''))
				font = ImageFont.truetype(font_io, size=fontsize)
				width, height = draw.multiline_textsize(i, font=font)
				
			draw.multiline_text(((x-width)/2,(y-height)/2), i, font=font, fill="black")
			frames.append(image)
		output = io.BytesIO()
		output.name = "out.gif"
		image = Image.new("RGB", (x, y), (255, 255, 255))
		image.save(output, save_all=True, append_images=frames, duration=100)
		output.seek(0)
		await message.delete()
		await message.client.send_file(message.chat_id, output)
	
		